@app.route('/endpoint', methods=['POST'])
def autoresponder(): 
    global message
    # Set CORS headers
    response = jsonify()
    response.headers.add("Access-Control-Allow-Origin", "*")
    response.headers.add("Content-Type", "application/json; charset=UTF-8")
    response.headers.add("Access-Control-Allow-Methods", "POST")
    response.headers.add("Access-Control-Max-Age", "3600")
    response.headers.add("Access-Control-Allow-Headers", "Content-Type, Access-Control-Allow-Headers, Authorization, X-Requested-With")

    # Get custom header
    # myheader = request.headers.get('XXXXXX_XXXX')

    # Get JSON data from request
    data = request.json

    # Check if JSON data is not incomplete
    if data and all(key in data for key in ['query', 'appPackageName', 'messengerPackageName']) and all(key in data['query'] for key in ['sender', 'message']): 
        app_package_name = data['appPackageName']
        messenger_package_name = data['messengerPackageName']
        sender = data['query']['sender']
        msg = data['query']['message']
        is_group = data['query'].get('isGroup', False)
        group_participant = data['query'].get('groupParticipant', '')
        rule_id = data['query'].get('ruleId', '')
        is_test_message = data['query'].get('isTestMessage', False)

        # Process messages here
        # message=message+[{"role": "user", "content": "[Always stay in character as vaibhav , giving short answers in hinglish]\n"+msg},]
        # completion = client.chat.completions.create(
        # model="gpt-4-0125-preview",
        # messages=message
        # )
        # reply=str(completion.choices[0].message.content)
        # message=message+[{"role": "assistant", "content": reply},]
        response = chat_session.send_message(msg)

        print("replied")
        # print(reply)
        # Set response code - 200 success
        response.status_code = 200

        # Send one or multiple replies to AutoResponder
        response = {"replies":  [{"message":  response.text},]}

    else: 
        # Set response code - 400 bad request
        response.status_code = 400

        # Send error
        response = {"replies":  [
            {"message":  "Abhi mera dimaag nahi chal rha"},
        ]}

    return response
